(function($, APP) {
    'use strict';

    var format = {
        to : function (value) {
            return Math.round(value);
        }
    };

    APP.Controls.Partials.Calculator = can.Control.extend({
        defaults: {
            events: {
                init: 'initForm',
                show: 'showForm'
            },
            typeId: false,
            changeTypeUrl: '',
            distanceEnabled: true,
            typeData: null,
            weight: [],
            distance: 0,
            currentDistance: 0
        }
    }, {

        /**
         *
         **/
        init: function() {

            this.element.find('.js-select').select2({
                width: '100%',
                minimumResultsForSearch: Infinity
            });
            this.changeTypeUrl = this.element.data('url');

        },

        '.js-submit click': function () {
            APP.helpers.seoCtrl.order2();
        },

        '.js-type click': function ($el) {
            $el.addClass('active');
            this.getTypeData($el.data('type-id'));
        },

        '.js-location change': function ($el) {
            if ($el.val() == 'moscow') {
                this.disableDistance();
            } else {
                this.enableDistance();
            }
            this.calculatePrice();
        },

        '.js-location-get click': function(el, ev){
            ev.preventDefault();

            this.element.addClass('loading');

            // Load script from yandex
            if (typeof ymaps !== 'undefined') {
                ymaps.ready(this.proxy('showUserLocation'));
            } else {
                $.getScript(
                    'http://api-maps.yandex.ru/2.0-stable/?load=package.standard&lang=ru-RU',
                    this.proxy(function() {
                        // Wait ymap load done
                        ymaps.ready(this.proxy('showUserLocation'));
                    })
                );
            }
        },

        showUserLocation: function(){

            if (!ymaps.geolocation.city || ymaps.geolocation.city.toLowerCase() === 'москва') {
                this.element.find('select[name=location]').val('moscow').trigger('change').trigger('chosen:updated');
            } else {
                this.element.find('select[name=location]').val('moscow_region').trigger('change').trigger('chosen:updated');

                var startPoint = this.element.data('start-point');
                if (typeof startPoint === 'object' && typeof startPoint.latitude !== 'undefined' && typeof startPoint.longitude !== 'undefined') {
                    startPoint.latitude = parseFloat(startPoint.latitude);
                    startPoint.longitude = parseFloat(startPoint.longitude);

                    if (startPoint.latitude > 0.0 && startPoint.longitude > 0.0) {
                        if (ymaps.geolocation.latitude > 0.0 && ymaps.geolocation.longitude > 0.0) {
                            var distance = this.calculateDistance(startPoint.latitude, startPoint.longitude, ymaps.geolocation.latitude, ymaps.geolocation.longitude);
                            this.distanceRange.noUiSlider.set([distance]);
                        }
                    }
                }
            }

            this.element.removeClass('loading');
        },

        calculateDistance: function(lat1, lon1, lat2, lon2) {
            var R = 6371; // км.
            var dLat = (lat2 - lat1).toRad();
            var dLon = (lon2 - lon1).toRad();
            var a = Math.sin(dLat / 2) * Math.sin(dLat / 2) +
                Math.cos(lat1.toRad()) * Math.cos(lat2.toRad()) *
                Math.sin(dLon / 2) * Math.sin(dLon / 2);
            var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
            return R * c;
        },


        initWeightRange: function (minWeight, maxWeight, minTonnage) {
            var self = this;
            this.$weightRange = this.element.find('.js-weight-range');
            this.weightRange = this.$weightRange.get(0);
            noUiSlider.create(this.weightRange, {
                start: [minWeight || 0, minTonnage || 700],
                tooltips: [ format, format],
                connect: true,
                step: 1,
                range: {
                    'min': minWeight || 0,
                    'max': maxWeight || 1000
                }
            });

            var $handle = this.$weightRange.find('.noUi-handle'),
                $tooltips = this.$weightRange.find('.noUi-tooltip'),
                checkTooltips;

            checkTooltips = function () {
                var diff = $handle.eq(1).offset().left - $handle.eq(0).offset().left;
                if (diff < 30) {
                    $tooltips.eq(0).css('margin-left', -32);
                    $tooltips.eq(1).css('margin-left', 2);
                } else {
                    $tooltips.eq(0).css('margin-left', -15);
                    $tooltips.eq(1).css('margin-left', -15);
                }
            };

            this.weightRange.noUiSlider.on('update', function(values) {
                self.options.weight = parseInt(values[1]);
                self.calculatePrice();
                checkTooltips();
                setTimeout(checkTooltips, 300);
            });
        },

        initDistanceRange: function (maxDistance, currentValue) {
            var self = this;
            this.$distanceRange = this.element.find('.js-distance-range');
            this.distanceRange = this.$distanceRange.get(0);
            noUiSlider.create(this.distanceRange, {
                start: currentValue || 0,
                tooltips: [ format ],
                connect: 'lower',
                step: 1,
                range: {
                    'min': 0,
                    'max': maxDistance || 200
                }
            });

            this.distanceRange.noUiSlider.on('update', function( values) {
                self.options.distance = parseInt(values[0]);
                self.calculatePrice();
            });

            if (this.element.find('.js-location').val() == 'moscow') {
                this.disableDistance();
            } else {
                this.enableDistance();
            }

        },

        getTypeData: function(typeId) {
            this.element.addClass('loading');
            this.element.find('.js-type').removeClass('active');
            this.element.find('#type-' + typeId).addClass('active');
            var self = this;
            $.ajax({
                url: self.changeTypeUrl,
                dataType: 'json',
                type: 'post',
                data: {
                    id: typeId
                },
                success: function(data) {
                    self.options.typeData = data;
                    self.options.minTonnage = data.minTonnage.maxWeight;
                    var minWeight = parseInt(data.extremumWeight.min);
                    var maxWeight = parseInt(data.extremumWeight.max);
                    if(self.weightRange) {
                        self.weightRange.noUiSlider.updateOptions({
                            range: {
                                'min': minWeight,
                                'max': maxWeight
                            }
                        });
                        self.weightRange.noUiSlider.set([minWeight, self.options.minTonnage]);
                    } else {
                        self.initWeightRange(minWeight, maxWeight, self.options.minTonnage);
                    }
                    if (!self.distanceRange) {
                        self.initDistanceRange();
                    }
                    self.element.removeClass('loading');
                }
            });
        },

        calculatePrice: function() {
            var typeData =          this.options.typeData;
            var weight =            this.options.weight;
            var distance =          this.options.distance;
            var basePrice =         typeData.basePrice;
            var distanceInterval =  typeData.distance;
            var distancePrice =     typeData.distancePrice;
            var maxTonnage =        this.options.typeData.maxTonnage;
            var coefficient =       maxTonnage.coefficient;

            $.each(typeData.tonnage, function(k, v) {
                if (weight <= parseFloat(v.maxWeight)) {
                    coefficient = parseFloat(v.coefficient);
                    return false;
                }
            });

            if (this.options.distanceEnabled) {
                var markUpDistance = (distance / distanceInterval) * distancePrice;
            } else {
                markUpDistance = 0;
            }
            this.price = parseFloat(basePrice) + (parseFloat(basePrice) * parseFloat(coefficient)) + parseFloat(markUpDistance);
            this.price = parseInt(this.price);
            this.element.find('.js-price').text(this.price);
        },

        enableDistance: function() {
            this.element.find('.js-distance-rang-wrap').show();
            this.options.distanceEnabled = true;
        },

        disableDistance: function() {
            this.element.find('.js-distance-rang-wrap').hide();
            this.options.distanceEnabled = false;
        },

        getPrice: function(){
            return this.price;
        },

        getInformation: function(){
            var result = '', value;
            // Car type
            result += this.element.find('.js-type.active').data('name');

            // Weight
            value = this.weightRange.noUiSlider.get();
            value[0] = parseInt(value[0]);
            value[1] = parseInt(value[1]);
            if (value[0] == value[1]) {
                result += ', ' + value[0] + ' кг';
            } else {
                result += ', ' + value[0] + ' - ' + value[1] + ' кг';
            }

            // Location
            result += ', ' + this.element.find('select[name=location] option:selected').text();

            // Distance
            value = this.distanceRange.noUiSlider.get();

            value = parseInt(value);
            if (value > 0) {
                result += ', эвакуация на ' + value + ' км'
            }

            return result;
        }

    });

})(jQuery, window.APP);
/* End */
