(function($, APP) {
    'use strict';

    APP.Controls.Partials.InnerMenu = can.Control.extend(
        {
            defaults: {
                menuItem: 'li',
                activeClass: 'active',
                nav : '.js-nav',
                navNavigationLeft: '.js-menu-left',
                navNavigationRight: '.js-menu-right',

                events: {
                    onShow: 'onShow'
                }
            }
        },
        {

        /**
         *
         **/
        init: function() {
            this.$items = this.element.find('.js-item');

            if (this.$items.length == 0) return;

            this.$win = $(window);
            this.$wrapper = this.element.find('.js-wrapper');

            this.element.css({height: this.element.outerHeight() + 6});
            this._init();

        },

        '{window} resize': function () {
            this._init();
        },

        _init: function () {
            this.itemsWidth = this.$items.eq(0).outerWidth() * this.$items.length;
            this.winWidth = this.$win.width();
            this.offset = 0;
            this.max = this.winWidth - this.itemsWidth - 75;

            this.initMenuVriant();

            this.$wrapper.css({width: this.itemsWidth});

            if (this.element.hasClass('small')) {
                this.showActiveItem();
            }
        },

        initMenuVriant: function () {
            if ((this.winWidth - 80) < this.itemsWidth) {
                this.element.addClass('small');
            } else {
                this.element.removeClass('small');
                this.$wrapper.css({transform: "translateX(0)"})
            }
        },

        '{navNavigationLeft} mouseenter': function() {
            this.move = setInterval(function() {
                this.getOffset(5);
                this.animate(false);
            }.bind(this), 10);

        },

        '{navNavigationRight} mouseenter': function() {
            this.move = setInterval(function() {
                this.getOffset(-5);
                this.animate(false);
            }.bind(this), 10);
        },

        '{navNavigationLeft} mouseleave': function () {
            clearInterval(this.move);
        },

        '{navNavigationRight} mouseleave': function () {
            clearInterval(this.move);
        },

        getOffset: function(e) {
            if (e < 0 && (this.offset > 0 ||  this.offset > this.max)) {
                this.offset+= e;
            } else if (e > 0 && (this.offset < 0 ||  this.offset < this.max)) {
                this.offset+= e;
            }
        },

        animate : function() {
            this.$wrapper.css({
                transform: 'translateX(' + this.offset + 'px)'
            });
        },

        showActiveItem: function () {
            var activeItem = this.element.find('.js-item.active');
            if (activeItem.length > 0) {
                if (activeItem.offset().left + activeItem.outerWidth() > this.$win.width() - 40) {
                    this.offset = -(activeItem.offset().left + activeItem.outerWidth() - this.$win.width() + 40);
                    this.animate(false);
                }
            }
        }
    });

})(jQuery, window.APP);
/* End */
