(function($, APP) {
    'use strict';

    APP.Controls.Partials.FormFeedback = APP.Controls.Partials.Form.extend({

        /**
         *
         **/
        init: function() {
            this._super();

            this.element.find('#form_text_7').mask('+7 999 999 99 99');
        },

        '.js-submit click': function (el, e) {
            this.element.submit();
        },

        submitHandler: function() {
            this.element.fadeTo('fast', .5);

            $.post(this.element.attr('action'), this.element.serialize(), function(res) {
                this.element.fadeTo('fast', 1);

                if (res.result === true) {
                    this.showSuccess();
                    if (APP.helpers.isContactsPage()) {
                        APP.helpers.seoCtrl.feedbackContacts();
                    } else {
                        APP.helpers.seoCtrl.feedback();
                    }
                    this.element.resetForm();
                } else {
                    for (var prop in res.errors) {
                        if (!res.errors.hasOwnProperty(prop)) continue;

                        var $parent = this.element.find('#' + prop).closest('.input-field');
                        if (this.element.find('#' + prop + "-error").length == 0) {
                            $("<div/>", {
                                "class": "error error-message",
                                "id": prop + "-error"
                            }).appendTo($parent);
                        }
                        this.element.find('#' + prop + "-error").text(res.errors[prop]).show();
                        $parent.addClass('error');
                    }
                    this.element.find('.error').eq(0).find('input').focus();
                }
            }.bind(this));
        },

        showSuccess: function () {
            var popupH = $(window).height();

            $.fancybox($("#popup-success-message"), {
                padding    : 0,
                margin     : 0,
                autoCenter : false,
                openEffect : 'none',
                autoSize   : false,
                autoScale  : false,
                minWidth   : 1180,
                maxWidth   : '100%',
                width      : '100%',
                nextEffect : 'none',
                prevEffect : 'none',
                helpers: {
                    overlay: {
                        locked: true
                    }
                },

                beforeShow: function() {
                    this.width = $(window).width();
                    this.height = popupH;
                }
            });
        }
    });

})(jQuery, window.APP);
