(function($, APP) {
    'use strict';

    /**
     * Контроллер страницы мест
     **/
    APP.Controls.Page.Places = can.Control.extend({

        /**
         *
         **/
        init: function() {
            if (this.element.find('.slider-block').length > 0) {
                new APP.Controls.Partials.Order(this.element);
            }

            var popupH = $(window).height();
            var scrollLock = false;
            var scrollTopValue = 0;
            var scrollTopNewValue = 0;

            this.element.find('.js-callback-form-btn').fancybox($.extend({}, APP.helpers.fancyboxSettings, {
                beforeShow: function() {
                    this.width = $(window).width();
                    this.height = popupH;

                    if (scrollLock == false) {
                        scrollLock = true;
                        scrollTopValue = $(window).scrollTop();
                        scrollTopNewValue = $('body').outerHeight() - $(window).outerHeight() - $('footer').outerHeight();
                        $(window).scrollTo(scrollTopNewValue, 400);
                    }
                },

                beforeClose: function () {
                    $(window).scrollTo(scrollTopValue, 400);
                    scrollLock = false;
                }
            }));
        }
    });

})(jQuery, window.APP);
